import React from 'react';
import NotificationCenter from './NotificationCenter';
import SmartSearch from './SmartSearch';

const LayoutHeader = () => {
  const handleSearch = (query) => {
    console.log('Búsqueda realizada:', query);
    // Implementar lógica de búsqueda
  };

  return (
    <header className="bg-white shadow-sm">
      <div className="max-w-7xl mx-auto px-4 py-4 flex items-center justify-between">
        <div className="flex items-center">
          <div className="flex items-center justify-center w-10 h-10 rounded-lg bg-blue-600 text-white mr-3">
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 5H7a2 2 0 00-2 2v12a2 2 0 002 2h10a2 2 0 002-2V7a2 2 0 00-2-2h-2M9 5a2 2 0 002 2h2a2 2 0 002-2M9 5a2 2 0 012-2h2a2 2 0 012 2" />
            </svg>
          </div>
          <h1 className="text-xl font-semibold text-gray-800">CliniSys Pro</h1>
        </div>

        <div className="flex-1 max-w-xl mx-4">
          <SmartSearch onSearch={handleSearch} />
        </div>

        <div className="flex items-center space-x-4">
          <NotificationCenter />
          <div className="h-8 w-8 rounded-full bg-gray-200 flex items-center justify-center">
            <span className="text-sm font-medium text-gray-600">DG</span>
          </div>
        </div>
      </div>
    </header>
  );
};

export default LayoutHeader;
